    (NULL,'19.2.0','https://realta.co.id/hospitality-system/',NULL,79,'blog','com_content','Blog','blog',NULL,NULL,1,'{"category_layout":"","image":""}',NULL,NULL,'{"author":"","robots":""}','2018-09-06 14:51:05','0000-00-00 00:00:00',0,'*',1,'admin',1,NULL,351,'Super User','admin','realta@realta.co.id','$2y$10$Dj2PXXE.I7w62SFkS/r5/u3DgpHXI8wn6ZypRlAKjPW6C5giMdpGa',0,1,'2018-09-06 14:51:06','2021-05-18 10:40:34',0,NULL,'0000-00-00 00:00:00',0,NULL,NULL,0,'["Public","Super Users"]',NULL,4,'kepribadian-bedasarkan-shio','Kepribadian bedasarkan Shio','kepribadian-bedasarkan-shio',NULL,NULL,1,'{}',NULL,NULL,'{}','2019-02-01 09:32:31',NULL,'2019-02-01 09:32:31','{}','{}',1494,'*',1,'2019-02-01 09:32:31','2019-02-01 09:32:31','admin',1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
    (NULL,'19.2.0','https://realta.co.id/hospitality-system/',NULL,79,'blog','com_content','Blog','blog',NULL,NULL,1,'{"category_layout":"","image":""}',NULL,NULL,'{"author":"","robots":""}','2018-09-06 14:51:05','0000-00-00 00:00:00',0,'*',1,'admin',1,NULL,351,'Super User','admin','realta@realta.co.id','$2y$10$Dj2PXXE.I7w62SFkS/r5/u3DgpHXI8wn6ZypRlAKjPW6C5giMdpGa',0,1,'2018-09-06 14:51:06','2021-05-18 10:40:34',0,NULL,'0000-00-00 00:00:00',0,NULL,NULL,0,'["Public","Super Users"]',NULL,5,'shio-2019','Shio 2019','shio-2019',NULL,NULL,1,'{}',NULL,NULL,'{}','2019-02-01 09:32:31',NULL,'2019-02-01 09:32:31','{}','{}',1560,'*',1,'2019-02-01 09:32:31','2019-02-01 09:32:31','admin',1,NULL,88,'Ini sifat kepribadian kamu berdasarkan 12 Shio di Tahun Babi 2019','kepribadian-berdasarkan-shio','<p><span style="font-size: 12.16px;">Kamu mungkin tahu ada 12 hewan zodiak Tiongkok (Shio) yang digunakan untuk mewakili tahun Babi di tahun 2019. Lebih dari 2.000 tahun yang lalu Sistem 12 shio telah ada dalam...</span></p>','<p>Dalam infografis dibawah ini, cari tahu apa shio dari tahun kelahiran mu dan cek kepribadian mu berdasarkan shio tersebut.</p>
<p><img src="images/blog/INFOGRAFIK-SHIO-BABI-2019-REALTA-CHAKRADARMA.png" alt="" /></p>
<p><br />1. TIKUS</p>
<p>Tikus itu pintar, pemikir cepat; sukses, tetapi puas dengan menjalani kehidupan yang tenang dan damai. Optimis dan energik, orang yang lahir pada tahun Tikus disukai oleh semua.</p>
<p> </p>
<p>2. KERBAU</p>
<p>Kerbau adalah pekerja keras di latar belakang, cerdas dan dapat diandalkan, tetapi tidak pernah menuntut pujian. Lembu itu jujur dan sungguh-sungguh. Jarang kehilangan kesabaran, mereka berpikir secara logis dan menjadi pemimpin yang hebat.</p>
<p> </p>
<p>3. HARIMAU</p>
<p>Harimau adalah orang yang berani dan aktif yang menyukai tantangan dan petualangan yang baik dalam hidup. Mereka baik dan murah hati. Hewan, musik, atau hal-hal lain yang membutuhkan imajinasi baik untuk mereka.</p>
<p> </p>
<p>4. KELINCI</p>
<p>Kelinci sungguh-sungguh dengan segala yang mereka lakukan; mereka hanya meminta orang lain memperlakukan mereka dengan cara yang sama. Mereka terus bergerak menuju tujuan mereka, tidak peduli negatif apa pun yang diberikan orang lain kepada mereka.</p>
<p> </p>
<p>5. NAGA</p>
<p>Naga adalah sosok yang kuat dan mandiri, tetapi mereka mendambakan dukungan dan cinta. Naga sangat pandai dalam merencanakan dan menghasilkan ide. Tetapi mereka membutuhkan orang lain untuk membantu dengan detail lain-lain.</p>
<p> </p>
<p>6. ULAR</p>
<p>Ular memiliki pikiran yang dalam dan kompleks, tetapi jika mereka mencintai, mereka mencintai dengan sepenuh hati. Ular itu lucu dan canggih. Dalam lingkungan yang kacau, mereka adalah mata badai. Ular mampu bertahan dan dengan tenang memikirkan solusi.</p>
<p> </p>
<p>7. KUDA</p>
<p>Kuda penuh energi, rajin belajar dan atletis, mereka sangat percaya mengejar mimpi. Alih-alih kekayaan dan ketenaran, kebahagiaan adalah yang memotivasi mereka.</p>
<p> </p>
<p>8. KAMBING</p>
<p>Kambing penuh kasih dan tidak mementingkan diri sendiri, selalu berpikir untuk orang lain, bahkan jika itu bertentangan dengan minat mereka sendiri.</p>
<p> </p>
<p>9. MONKEY</p>
<p>Monyet adalah orang iseng ringan yang memiliki kemampuan untuk mencapai semua impian mereka. Mereka bersedia mendengarkan kritik dan belajar dari kesalahan mereka. Mereka adalah pemikir yang tenang dan logis.</p>
<p> </p>
<p>10. ROOSTER</p>
<p>Ayam jantan serius dalam pekerjaan mereka. Mereka lugas dan tegas dalam tindakan mereka. Mereka akan langsung mengkritik apa yang mereka lihat tidak layak dan perfeksionis. Mereka logis dan pandai mengelola tim.</p>
<p> </p>
<p>11. DOG</p>
<p>Anjing adalah sahabat sejati dan mitra paling andal. Mereka tidak akan pernah meninggalkan teman, keluarga, atau pekerjaan mereka. Mereka juga pandai membantu orang lain menemukan dan memperbaiki kebiasaan buruk mereka.</p>
<p> </p>
<p>12. BABI</p>
<p>Babi memiliki kepribadian yang indah dan diberkati dengan keberuntungan dalam hidup. Babi mungkin tidak menonjol di tengah orang banyak. Tetapi mereka sangat realistis.</p>
<p> </p>
